import React from 'react';
import '../../App.js'
import Footer from '../Footer.js';


export default function python() {
    return (
    <>
    <h1 className='python'>Python Projects</h1>
    <div>
    <h1>Machine learning: A Quick introduction</h1>
    <p>Machine Learning is just a fancy way of saying prediction analysis with this use of specific statistical analysis without specific instructions. Machine learning algorithms are flexible and adapt quickly to new data. Some terms worth knowing overfitting, underfitting, and confusion matrix. </p>
    <p></p>
    <p></p>
    <p></p>
    <p></p>
    </div>
    <Footer />
    </>);
  }
